package com.volcengine.speech;


import com.volcengine.speech.model.CreateToneRequest;
import com.volcengine.speech.model.CreateToneResponse;
import com.volcengine.speech.service.SpeechService;
import okhttp3.ConnectionPool;
import okhttp3.Dispatcher;

import java.util.Collections;
import java.util.UUID;
import java.util.concurrent.TimeUnit;

public class CreateToneExample {

    static String apiKey = "SdU1JwE7ea7s04SFNLiYNJ1hWQvAIOlm";
    static ConnectionPool connectionPool = new ConnectionPool(5, 1, TimeUnit.SECONDS);
    static Dispatcher dispatcher = new Dispatcher();
    static SpeechService service = SpeechService.builder().dispatcher(dispatcher).connectionPool(connectionPool).apiKey(apiKey).build();

    public static void main(String[] args) {
        System.out.println("\n----- standard request -----");

        CreateToneRequest createToneRequest = CreateToneRequest.builder()
                .reqId(UUID.randomUUID().toString())
                .appid("3190114174")
                .speakerId("S_TRIHghUd1")
//                .audios(Collections.singletonList(CreateToneRequest.Audio.builder().audioBytes("").audioFormat("mp3").build()))
                .audios(Collections.singletonList(CreateToneRequest.Audio.builder().audioBytes("").audioFormat("mp3").build()))
                .source(2)
                .language(0)
                .modelType(1)
                .build();

        CreateToneResponse chatCompletionResult =  service.createTone(createToneRequest);

        System.out.println("\n----- streaming request -----");
        System.out.println(chatCompletionResult.getSpeakerId());


        // shutdown service after all requests is finished
        service.shutdownExecutor();
    }

}
